a, b = map(int, input().split())
ab = str(a) + str(b)
flag = False

for i in range(1, 500):
    if i**2 == int(ab):
        flag = True

if flag:
    print('Yes')
else:
    print('No')

0fbecb13-0ae1-4098-8187-0fa3d228633e.text:
N = int(input())

flag = 1

for i in range(N):
    t, x, y = map(int, input().split())
    if (x+y)%2!=t%2 or x+y>t:
        flag = 0

if flag:
    print("Yes")
else:
    print("No")
